var as;
var timer;
var timer1;
var speedFactor;
var lives;
var livesTotal;
var score;
var wordsTyped;
var gameIsRunning;

function setup() {
	createCanvas(window.innerWidth, window.innerHeight - 4);
	noStroke();
	frameRate(60);
	as = [];
	background(0);
	timer = 1;
	speedFactor = 1;
	lives = 20 * 9;
	score = 0;
	wordsTyped = 0;
	livesTotal = lives;
	as.push(new Asteroid());
	gameIsRunning = true;

}

function draw() {

	background(0);
	if (gameIsRunning) {
		for (var i = 0; i < as.length; i++) {
			as[i].move();
			as[i].display();
		}
		fill(255, 0, 0);
		stroke(0);
		rect(3, 3, width * .4 * (lives / livesTotal), height * .05);

		stroke(0);
		fill(255);
		textAlign(LEFT);
		text("Score:" + floor(score), width - (width * .15), height * .045);

		stroke(0);
		fill(255);
		textAlign(RIGHT);
		text("WPM:" + floor(wordsTyped / (timer / 60)), width - (width * .2), height * .045);

		stroke(0);
		fill(0);
		textAlign(LEFT);
		textSize(height * .045);
		text("HP", 10, height * .045);

		if (timer % 12 == 0) {
			as.push(new Asteroid());
			timer++;
		}
		if (frameCount % 60 == 0) {
			timer++;
		}
		if (lives <= 0)
			showHighScores(score);
		speedFactor += .00001;
	} else {
		rgbCount += 1;
		rgb = getRgb(rgbCount)
	}
}

document.getElementById("myTextBox").onkeypress = function (event) {
	console.log(event);
	if (event.keyCode == 13 || event.which == 13) {
		var typed = document.getElementById("myTextBox").value
		console.log(typed)
		for (var i = 0; i < as.length; i++)
			if (typed == as[i].word) {
				as[i].init();
				as[i].x = width + 200;
				score += typed.length * speedFactor;
				wordsTyped++;
			}
		document.getElementById('myTextBox').value = "";
	}
};

function Asteroid() {

	this.init = function () {
		this.word = words[floor(random(0, words.length))];
		this.x = width;
		this.y = random(height * .05 + 15, height * .95 - 30);
		this.xvel = random(2, 4);
		this.colc = random(0, 1530);
		this.col = getRgb(this.colc);
	}
	this.init();

	this.move = function () {

		this.x -= this.xvel * speedFactor;
		if (this.x <= 0) {
			this.init();
			lives -= this.word.length;
		}

	}

	this.display = function () {

		this.col = getRgb(this.colc);
		stroke(0);
		textSize(floor(Math.sqrt(width * height) * .023));
		fill(this.col[0], this.col[1], this.col[2]);
		text(this.word, this.x, this.y);
		this.colc += 5;

	}

}

